def prime_factors(numbers):
    number = numbers[100]
    i = 2
    factors = []
    while i * i <= number:
        if number % i:
            i += 1
        else:
            number //= i
            factors.append(i)
    if number > 1:
        factors.append(number)

    return set(factors)
